import 'package:convert/convert.dart';
import 'package:dartsv/dartsv.dart';

/**
 * This builds the locking script for the Partial SHA256 calculation in the token transaction
 * It is positioned as Output[3] (the 4th output).
 *
 * Constructor : This template doees not require any constructor or initializer arguments.
 */
class PartialWitnessLockBuilder extends LockingScriptBuilder {

  //DEBUG
  // String template = "";
  String template = "";

  //RELEASE
  // String template = "";

  @override
  SVScript getScriptPubkey() {
    return SVScript.fromHex(template);
  }

  @override
  void parse(SVScript script) {
    template = hex.encode(script.buffer);
  }



}